  NavItem,
  NavLink
} from "reactstrap";
import Main from "./main";
import LeftNav from "./leftnav";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Container fluid>
          <Navbar dark color="dark">
            <NavbarBrand href="/">My React App</NavbarBrand>
          </Navbar>
          <Row>
            <Col xs="2"></Col>
            <Col xs="8">
              <Main></Main>
            </Col>
            <Col xs="2">
              <Navbar>dddd</Navbar>
            </Col>
          </Row>
        </Container>
      </React.Fragment>
    );
  }
}

